<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>4 Minutes Until Stream</title>

    <style>
        body {
            width: 100vw;
            height: 100vh;
            overflow: hidden;
            margin: 0px;
            background-color: #1b2622;
        }
        #Clock-outer-ring {
            transform-origin: center;
            animation-name: clockwise;
            animation-duration: 60s;
            animation-timing-function: linear;
            animation-iteration-count: infinite;
        }
        #Clock-Inner-ring {
            transform-origin: center;
            animation-name: counterclockwise;
            animation-direction: reverse;
            animation-duration: 60s;
            animation-timing-function: linear;
            animation-iteration-count: infinite;
        }
        #_4-minutes-before-stream {
            stroke: black;
            stroke-width: 0.02px;
        }
        #time-and-location {
            stroke: black;
            stroke-width: 0.01px;
        }
        #Film-Strip-Top, #Film-Strip-Bottom {
            transform-origin: center;
            animation-name: strip-scroll;
            animation-duration: 2s;
            animation-timing-function: linear;
            animation-iteration-count: infinite;
        }
        #Film-Strip-Bottom {
            animation-name: strip-scroll-bottom;
        }

        @keyframes strip-scroll {
            from {
                transform: translateX(-20px);
            }
            to {
                transform: translateX(-110px);
            }
        }

        @keyframes strip-scroll-bottom {
            from {
                transform: matrix(1.00775,0,0,0.983204,-70.2326,987.07) translateX(-20px);
            }
            to {
                transform: matrix(1.00775,0,0,0.983204,-70.2326,987.07) translateX(-110px);
            }
        }

        @keyframes clockwise {
            from {
                transform: matrix(1,0,0,1,3,0) rotate(0deg);
            }
            to {
                transform: matrix(1,0,0,1,3,0) rotate(360deg);
            }
        }
        @keyframes counterclockwise {
            from {
                transform: matrix(0.495262,0,0,0.495262,3,0) rotate(0deg);
            }
            to {
                transform: matrix(0.495262,0,0,0.495262,3,0) rotate(360deg);
            }
        }
    </style>
</head>
